  const items = Object.entries(props.ingredients);
  console.log(items);

  items.map((el) => {
    console.log(el);
  });

  content = <p>ingredients</p>;
  return (
    <div className={css.flexBurgerContainer}>
      <BurgerIngredient type="breadTop" className="bread-top" />
      {content}
